import React from "react";
import "../../styles/HomePage/Service.css";

// Import images
import appointment from "../../assets/HomePage/services/appointment.png";
import consultation from "../../assets/HomePage/services/consultation.png";
import pharmacy from "../../assets/HomePage/services/pharmacy.png";
import labtest from "../../assets/HomePage/services/labtest.png";
import healthpackages from "../../assets/HomePage/services/healthpackages.png";
import ambulance from "../../assets/HomePage/services/ambulance.png";
import surgery from "../../assets/HomePage/services/surgery.png";
import dentalcare from "../../assets/HomePage/services/dentalcare.png";
import mentalhealth from "../../assets/HomePage/services/mentalhealth.png";
import physiotherapy from "../../assets/HomePage/services/physiotherapy.png";
import nutrition from "../../assets/HomePage/services/nutrition.png";
import insurance from "../../assets/HomePage/services/insurance.png";

const services = [
  { name: "Book Appointment", image: appointment },
  { name: "Online Consultation", image: consultation },
  { name: "Pharmacy", image: pharmacy },
  { name: "Lab Test", image: labtest },
  { name: "Health Packages", image: healthpackages },
  { name: "Ambulance", image: ambulance },
  { name: "Surgery", image: surgery },
  { name: "Dental Care", image: dentalcare },
  { name: "Mental Health", image: mentalhealth },
  { name: "Physiotherapy", image: physiotherapy },
  { name: "Nutrition & Diet", image: nutrition },
  { name: "Health Insurance", image: insurance },
];

const Service = () => {
  return (
    <div className="ourservices-section">
      <h2 className="ourservices-title">Our Services</h2>
      <div className="ourservices-container">
        {services.map((service, index) => (
          <div className="ourservice-card" key={index}>
            <img src={service.image} alt={service.name} className="ourservice-icon" />
            <h3 className="ourservice-name">{service.name}</h3>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Service;
